PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX brick: <https://brickschema.org/schema/1.3/Brick#>

SELECT ?equipment ?point ?equipmentLabel ?pointLabel WHERE {
  # Identify points that are Zone Air Temperature Setpoints
  ?point a brick:Zone_Air_Temperature_Setpoint .

  # Find the equipment that is associated with each point (commonly via hasPoint)
  ?equipment brick:hasPoint ?point .

  # Optional human‑readable labels
  OPTIONAL { ?equipment rdfs:label ?equipmentLabel . }
  OPTIONAL { ?point rdfs:label ?pointLabel . }
}
ORDER BY ?equipment ?point

PREFIX brick: <https://brickschema.org/schema/1.3/Brick#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?equipment ?equipmentLabel ?setpoint ?setpointValue WHERE {
  ?equipment a brick:Equipment .
  ?equipment brick:hasPoint ?setpoint .
  ?setpoint a brick:Zone_Air_Temperature_Setpoint .
  OPTIONAL { ?setpoint brick:hasValue ?setpointValue . }
  OPTIONAL { ?equipment rdfs:label ?equipmentLabel . }
}
ORDER BY ?equipmentLabel

PREFIX brick: <https://brickschema.org/schema/1.3/Brick#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
SELECT ?setpoint ?equipment ?setpointLabel WHERE {
  ?setpoint rdf:type/rdfs:subClassOf* brick:Zone_Air_Temperature_Setpoint .
  OPTIONAL { ?setpoint rdfs:label ?setpointLabel . }
  OPTIONAL {
    { ?setpoint brick:isPointOf ?equipment . }
    UNION
    { ?equipment brick:hasPoint ?setpoint . }
  }
}
LIMIT 200

