PREFIX brick: <https://brickschema.org/schema/1.3/Brick#>
SELECT ?point ?equipment WHERE {
  ?point a brick:Zone_Air_Temperature_Setpoint .
  ?equipment brick:hasPoint ?point .
}

PREFIX brick: <https://brickschema.org/schema/1.1/Brick#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

# Find equipment (devices) that have an Air_Temperature_Setpoint point and are located in a zone
SELECT DISTINCT ?device ?deviceLabel ?point ?pointLabel WHERE {
  # Device is an equipment entity (e.g., AHU, VAV, etc.)
  ?device a brick:Equipment .
  OPTIONAL { ?device rdfs:label ?deviceLabel }

  # Device contains a point that is an Air_Temperature_Setpoint (or subclass)
  ?device brick:hasPoint ?point .
  ?point a ?pointType .
  ?pointType rdfs:subClassOf* brick:Air_Temperature_Setpoint .
  OPTIONAL { ?point rdfs:label ?pointLabel }

  # Device is associated with a zone (optional, many devices are zone‑level)
  OPTIONAL {
    ?device brick:hasLocation ?zone .
    ?zone a brick:Zone .
  }
}
ORDER BY ?deviceLabel ?pointLabel

PREFIX brick: <https://brickschema.org/schema/1.1/Brick#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?zone ?zoneLabel ?temp ?device ?deviceLabel WHERE {
  ?zone a brick:Zone .
  OPTIONAL { ?zone rdfs:label ?zoneLabel . }
  ?setpoint a brick:Temperature_Setpoint .
  ?setpoint brick:hasLocation ?zone .
  ?setpoint brick:hasValue ?temp .
  OPTIONAL {
    ?device a brick:HVAC_Equipment .
    ?device brick:hasPoint ?setpoint .
    OPTIONAL { ?device rdfs:label ?deviceLabel . }
  }
}
ORDER BY ?zone

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX brick: <https://brickschema.org/schema/1.3/Brick#>

SELECT ?equipment ?equipmentLabel ?sensor ?sensorLabel
WHERE {
  ?equipment rdf:type brick:Equipment .
  ?equipment brick:hasPoint ?sensor .
  ?sensor rdf:type brick:Supply_Air_Temperature_Sensor .
  OPTIONAL { ?equipment rdfs:label ?equipmentLabel . }
  OPTIONAL { ?sensor rdfs:label ?sensorLabel . }
}
ORDER BY ?equipment
